sources.style.scss:
body {
  line-height: 1.5;
  font-weight: 400;
}
.navigator {
  width: 1500px;
  display: flex;
  padding: 0 0 0 8%;
  .nav_logo {
    margin: 1px 0 0;
    padding: 16px 22px 16px 10px;
    img {
      width: 108px;
      height: 23px;
      margin: -3px 0 0;
    }
  }
  .menu_items {
    width: 826px;
    padding-bottom: 8px;
    display: flex;
    align-items: center;
    font-size: 13px;
    li {
      padding: 16px 14px 10px;
      a {
        color: #262626;
        text-decoration: none;
      }
    }
    li:hover {
      margin-bottom: 1px;
      text-decoration: underline 2px;
    }
  }
  .actions {
    display: flex;
    padding-left: 150px;
    padding-top: 12px;
    font-size: 13px;
    a {
      text-decoration: none;
      color: #262626;
    }
    a:hover {
      text-decoration: underline 2px;
    }
    .ms_all_nav {
      padding-right: 16px;
    }
    .shopping_cart {
      padding-right: 16px;
    }
    .login {
      display: flex;
    }
  }
}
.main_image {
  height: 600px;
  transition-duration: 1s;
  .main_background {
    width: 100%;
    height: 600px;
    position: relative;
    overflow: hidden;
  }
  .inner-text {
    position: relative;
    width: 600px;
    left: 1150px;
    top: -400px;
    cursor: pointer;
    .badge {
      background-color: #ffb900;
      display: inline-block;
      font-weight: 600;
      line-height: 1;
      padding: 8px 12px;
    }
    h1 {
      font-size: 32px;
      font-weight: 600;
      margin-bottom: 20px;
    }
    p {
      font-size: 16px;
      margin-bottom: 20px;
    }

    .main-image-btn {
      a {
        text-decoration: none;
        color: white;
      }
      outline: none;
      padding: 8px 16px;
      background-color: #0067b8;
      color: white;
      border: 0px;
      border-radius: 2px;
      font-weight: 600;
      cursor: pointer;
      font-size: 15px;
    }
    .main-image-btn:hover {
      background-color: #015fa7;
    }
  }
}
.link_list {
  ul {
    display: flex;
    padding: 60px 75px;
    justify-content: center;
    li {
      margin: 16px 24px;
      font-weight: 600;
      .link-img {
        text-align: center;
      }
      a {
        color: #0067b8;
      }
    }
  }
}
.card_layout {
  width: 90%;
  height: 600px;
  margin: 0 auto;
  .inner {
    padding: 75px;
    display: flex;
    justify-content: center;
    .card {
      padding: 0 15px;
      position: relative;
      .badge {
        background-color: #ffb900;
        display: inline-block;
        font-weight: 600;
        line-height: 1;
        padding: 8px 12px;
        position: relative;
      }
      h2 {
        font-size: 29px;
        font-weight: 600;
        margin-top: 30px;
      }
      p {
        line-height: 1.5;
      }
      .footer {
        background-color: transparent;
        margin: 16px 0 0 0;
        a {
          text-decoration: none;
          color: #0067b8;
          font-weight: 700;
        }
      }
      .footer {
        a :hover {
          transform: translateX(10px);
          transition: 0.2s;
        }
      }
    }
  }
  .card_img {
    width: 320px;
    height: 180px;
    h2 {
      font-size: 29px;
      font-weight: 600;
      margin: 16px 0;
    }
    p {
      font-size: 16px;
      font-weight: 400;
      line-height: 1.5;
    }
  }
}
.business_card_layout {
  width: 90%;
  height: 650px;
  margin: 0 auto;
  .business_card_title {
    font-weight: 600;
    line-height: 1.2;
    font-size: 35px;
    position: relative;
    top: 20px;
    left: 30px;
  }
  .inner {
    padding: 75px 0 0 0;
    display: flex;
    justify-content: center;
    .card {
      padding: 0 15px;
      width: 320px;
      height: 180px;
      .badge {
        background-color: #ffb900;
        display: inline-block;
        font-weight: 600;
        line-height: 1;
        padding: 8px 12px;
        position: relative;
      }
      img {
        width: 320px;
        height: 180px;
      }
      h2 {
        font-size: 29px;
        font-weight: 600;
        margin-top: 30px;
      }
      p {
        font-size: 16px;
        font-weight: 400;
        line-height: 1.5;
      }
      .footer {
        background-color: transparent;
        margin: 16px 0 0 0;
        a {
          text-decoration: none;
          color: #0067b8;
          font-weight: 700;
        }
      }
      .card_img {
        width: 320px;
        height: 180px;
        h2 {
          font-size: 29px;
          font-weight: 600;
          margin: 16px 0;
        }
        p {
          font-size: 16px;
          font-weight: 400;
          line-height: 1.5;
        }
      }
    }
  }
}
.one-container {
  position: relative;
  cursor: pointer;
  // margin: 0 auto;
  padding: 0 150px;
  .card-background {
    margin: 0 0.013px;
  }
  .card-text {
    width: 440px;
    left: 200px;
    position: absolute;
    top: 140px;
    h1 {
      font-size: 32px;
      font-weight: 600;
      margin-bottom: 20px;
    }
    p {
      font-size: 16px;
      margin-bottom: 20px;
    }
    .onedrive-btn {
      outline: none;
      padding: 8px 16px;
      background-color: #0067b8;
      color: white;
      border: 0px;
      border-radius: 2px;
      font-weight: 600;
      cursor: pointer;
      font-size: 15px;
    }
    .onedrive-btn:hover {
      background-color: #015fa7;
    }
  }
}
.follow_request {
  display: flex;
  padding: 0 200px;

  .follow_icon {
    display: flex;
    img {
      width: 32px;
      height: 32px;
    }
  }
}
.move_top {
  display: flex;
  justify-content: flex-end;
  margin-bottom: 50px;
  margin-right: 20px;
  .move_top_btn {
    font-weight: 600;
    padding: 10px 12px;
    border: 0px;
    border-radius: 2px;
    cursor: pointer;
    font-size: 16px;
  }
  .move_top_btn:hover {
    background-color: white;
    box-shadow: 2px 2px 2px 2px gray;
  }
}
.footer {
  background-color: #f2f2f2;
  .more_info {
    display: flex;
    justify-content: space-between;
    padding: 0 200px;
    p {
      color: #616161;
      font-size: 15px;
      padding: 36px 4px 16px 8px;
      font-weight: 600;
      line-height: 10px;
    }
    ul li {
      font-size: 11px;
      padding: 8px 8px 16px 8px;
      line-height: 8px;
    }
  }
  .base {
    color: #616161;
    padding: 30px 75px 30px 200px;
    justify-content: space-between;
    font-size: 11px;
    display: flex;
    .language {
      display: flex;
      a {
        text-decoration: none;
        color: #616161;
      }
      a:hover {
        text-decoration: underline;
      }
    }
    ul {
      display: flex;
      .bold {
        font-weight: 700;
      }
      li {
        padding: 0 24px 4px 0;
        justify-content: center;
      }
